import React, { useState, useEffect } from "react";
import { Line } from "react-chartjs-2";
import "./Dashboard.css";

const Dashboard = () => {
  const [metrics, setMetrics] = useState({
    totalWasteProcessed: 1500,
    totalWasteRemaining: 250,
    totalCyclesCompleted: 20,
    availableProducts: 600,
    wasteIntakeData: [
      { date: "2024-01-01", volume: 120 },
      { date: "2024-01-02", volume: 180 },
      { date: "2024-01-03", volume: 220 },
      { date: "2024-01-04", volume: 200 },
      { date: "2024-01-05", volume: 250 },
      { date: "2024-01-06", volume: 300 },
    ],
    recentViolations: [
      { facility: "Green Earth Composting", violation: "Exceeded composting limits", date: "2024-01-10" },
      { facility: "Eco Biogas Plant", violation: "Failure to report waste types", date: "2024-01-08" },
      { facility: "City Recycling Center", violation: "Improper sorting of recyclables", date: "2024-01-05" },
    ],
    enforcementActions: [
      { facility: "Green Earth Composting", action: "Notice of Violation issued", date: "2024-01-11" },
      { facility: "Eco Biogas Plant", action: "Fine imposed", date: "2024-01-09", amount: "$2,500" },
      { facility: "City Recycling Center", action: "Compliance order issued", date: "2024-01-06" },
    ],
  });

  useEffect(() => {
    const fetchData = () => {
      // Simulating data fetch
      setMetrics(prevMetrics => ({ ...prevMetrics }));
    };
    fetchData();
  }, []);

  const lineChartData = {
    labels: metrics.wasteIntakeData.map(item => item.date),
    datasets: [
      {
        label: "Waste Intake Over Time (tons)",
        data: metrics.wasteIntakeData.map(item => item.volume),
        borderColor: "#4CAF50",
        backgroundColor: "rgba(76, 175, 80, 0.2)",
        tension: 0.4,
      },
    ],
  };

  return (
    <div className="dashboard-container">
      <h1 className="dashboard-title">Waste Processing Dashboard</h1>
      <div className="dashboard-metrics">
        <div className="metric-card">
          <h2>Total Waste Processed</h2>
          <p>{metrics.totalWasteProcessed} tons</p>
        </div>
        <div className="metric-card">
          <h2>Total Waste Remaining</h2>
          <p>{metrics.totalWasteRemaining} tons</p>
        </div>
        <div className="metric-card">
          <h2>Completed Processing Cycles</h2>
          <p>{metrics.totalCyclesCompleted}</p>
        </div>
        <div className="metric-card">
          <h2>Available Products</h2>
          <p>{metrics.availableProducts}</p>
        </div>
      </div>
      <div className="charts-section">
        <h2>Waste Intake Over Time</h2>
        <Line data={lineChartData} />
      </div>
      <div className="violations-section">
        <h2>Recent Violations</h2>
        <ul>
          {metrics.recentViolations.map((violation, index) => (
            <li key={index}>
              {violation.date}: {violation.facility} - {violation.violation}
            </li>
          ))}
        </ul>
      </div>
      <div className="enforcement-actions-section">
        <h2>Enforcement Actions</h2>
        <ul>
          {metrics.enforcementActions.map((action, index) => (
            <li key={index}>
              {action.date}: {action.facility} - {action.action} {action.amount ? `(${action.amount})` : ''}
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Dashboard;
